import React from 'react';
import './App.css';
import { Link } from 'react-router-dom';

function Nav() {

  const navStyle = {
    color:'white'
  };

  return (
    <nav>
        <ul className="nav-links">
          <Link style={navStyle} to='/home'>
            <li>Home</li>
          </Link>
          <Link style={navStyle} to='/create'>
            <li>Create</li>
          </Link>
          <Link style={navStyle} to='/templates'>
            <li>Templates</li>
          </Link>
        </ul>
    </nav>
  );
}

export default Nav;
